import React from "react";

function Lista() {
  const elementos = [
    "Karate tradicional",
    "Defensa personal",
    "Entrenamiento físico",
    "Disciplina y respeto"
  ];

  return (
    <ul className="list-group mb-4">
      {elementos.map((item, index) => (
        <li key={index} className="list-group-item">
          {item}
        </li>
      ))}
    </ul>
  );
}

export default Lista;
